import React from "react";
import "./Login.css";
import { Link } from 'react-router-dom';


class Signup extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            errorMessage: ""
        }
    }

    signUserUp(){
        fetch("http://localhost:3001/signup",{
            headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json'
            },
            method: "POST",
            body: JSON.stringify({email: 'debug2', b: '123abc'})
        })
        .then(function(res){ console.log(res) })
        .catch(function(res){ console.log(res) })
        
        
    }
    
    render(){
        return (
            <>
                <div className="container" id="form-ouer">
              <div className="container">
                <form id="form" className="form">
                    <h2 className="formHeader">Register</h2>
                    <input className="formInput" placeholder="Email" type="text" name="name" id='name'/>
                    <br/>
                    <br/>
                    <input className="formInput" placeholder="Password" type="text" name="password" id='password'/>
                    <br/>
                    <br/>
                    <button onClick={this.signUserUp()} className="formButton" id="button" type="submit">SIGN UP</button>
                    <label className="outerLabel" for="button">Already have an account? <Link to="/" >Log in!</Link> </label>
                    <div className="formError" id="error">{this.state.errorMessage}</div>
                     
                    
                </form>
              </div>
              </div>

              
              </>
          );
    }
}

  
export default Signup;
